import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Holder from './ProductHolder'


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    height: 5,
  },
  paper: {
    padding: theme.spacing(4),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>
        <Grid item xs={3}>
          <Paper className={classes.paper}><Holder link="./product-1" productlabel="product-1"/></Paper>
        </Grid>
        <Grid item xs={6}>
          <Paper className={classes.paper}><Holder link="./product-2" productlabel="product-2"/></Paper>
        </Grid>
        <Grid item xs={6}>
          <Paper className={classes.paper}><Holder link="./product-3" productlabel="product-3"/></Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper className={classes.paper}><Holder link="./product-4" productlabel="product-4"/></Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper className={classes.paper}><Holder link="./product-5" productlabel="product-5"/></Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper className={classes.paper}>xs=3</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper className={classes.paper}>xs=3</Paper>
        </Grid>
      </Grid>
    </div>
  );
}

